import React from 'react';

function CourseManagement() {
  return (
    <div>
      <div>
      <h2>Course Management</h2>
      <p>Welcome to the Course Management page. Here you can manage all your courses.</p>

      </div>
      
    </div>
  );
}

export default CourseManagement;
